import styled from "styled-components";

export const Wrapper = styled.div`

    max-width: var(--maxWidth);
    margin: 0 auto;
    padding: 0 20px;

    h1{
        color: var(--medGrey);

        @media screen and (max-width)
    }

`;

export const Content = styled.div``;
